import React, { Component } from 'react'
import {Button} from 'react-bootstrap'
import NewAccom from './NewAccom.js'

let accomsURL = 'http://localhost:3000/accommodations/'


export default class AccomCard extends Component {
    constructor(){
        super()
        this.state = {
            accommodations: " "
        }
    }

    componentDidMount(){
        fetch(accomsURL, {
            method:'GET',
            headers:{
                'Content-Type': 'application/json',
                'Auth-Key': localStorage.getItem('auth_key')
            }
        })
        .then(res => res.json())
        .then(accommodations => {

            this.setState({accommodations})
        })
    }

    render() {
        return (
            <div>
            {this.props.accommodations.map(accommodation => accommodation.location)}<br/>
            {this.props.accommodations.map(accommodation => accommodation.date)}<br/>
            <Button> <NewAccom event_id={this.props.event.id} /> </Button>
            </div>
        )
    }
}
